import React from 'react';
import '../../css/Donate.css';
import '../../css/Home.css';
import seaImage from '../../img/donate/sea.jpg';
import { withTranslation } from 'react-i18next';

class Donate extends React.Component {
    render() {
        return (
            <div className="donate-container">
                <div className="donate-jumbotron donate-jumbotron-shadow">
                    <div className="donate-jumbotron-text">
                        <p>
                            Donations for Divelog
                        </p>
                    </div>
                </div>

                <div className="donate-center">
                    <div className="grid-container">
                        <div className="fb-item1">
                            <h1 className="font-size-grid-1">
                                {this.props.t("home.fb-title")}
                            </h1>
                            <p className="fb-pgh">
                                {this.props.t("home.fb-paragraph")}
                            </p>
                        </div>
                        <div className="donate-background"></div>
                    </div>
                </div>
            </div>
        );
    }
}

export default withTranslation('common')(Donate);
